import React, { useState } from "react";

const App = () => {

  const [currtime, updtime] = useState(Date().toLocaleTimeString())

  let time = new Date().toLocaleTimeString();

  setInterval(updtime(Date().toLocaleTimeString()))

  return (
    <>
      <h1> {time} </h1>
    </>
  );
};

export default App;
